import React from 'react';
import Navigation from '../components/Navigation';
import Iframe from 'react-iframe';

const Contact = () => {
    return (
        <div className="contact">
            <Navigation/>
            <div className="contactContent">
                <div className="header">
                    <div className="contactBox">
                        <h1>Contactez-moi</h1>
                        <ul>
                            <li>
                                <i className="fas fa-map-marker-alt"></i>
                                <span>Strasbourg 67000</span>                               
                                <Iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d84483.91435567342!2d7.692054587459059!3d48.56920590498952!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4796c8495e18b2c1%3A0x971a483118e7241f!2sStrasbourg!5e0!3m2!1sfr!2sfr!4v1606509787763!5m2!1sfr!2sfr"></Iframe>
                            </li>
                            <li>
                                <i className="fas fa-map-marker-alt"></i>
                                <a className="contactMaiTO" href="mailto:luc.burckel12@gmail.com">luc.burckel12@gmail.com</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Contact;
